def binary_search(data, search_num):
    data.sort()
    low = 1
    high = len(data) - 1
    while low <= high:
        mid = (low + high) // 2
        if data[mid] == search_num:
            return True
        elif search_num < data[mid]:
            high = mid - 1
        else:
            low = mid + 1
    return False

